{"blocks":[{"key":"66l5f","text":"Questionnaire: Baseline data was obtained which included detailed demographic data(age,sex,height,weight) and dietary habits(Non veg/veg) and oral hygiene practice details.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"793cl","text":"Dental examination: Teeth that were decayed, missing, filled due to caries were assessed and recorded according to oral health survey,2013 criteria[Annexure I]. Two indices were monitored DMFT and PUFA[22,23].PUFA[DSV1]index measures the presence of oral condition resulting from untreated caries ,This indexgives a gist of extent of severity of dental caries than merely focusing on presence or absence of caries. ","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[{"key":0,"offset":210,"length":3},{"key":1,"offset":213,"length":6}],"data":{}},{"key":"9ujn3","text":"[DSV1]Expand first tme

Saliva Sample Collection: Unstimulated saliva samples will be collected by Navazesh Protocol,1993 [24]. Subjects will be asked to abstain from smoking brushing of teeth, use of mouthwash, eat/drink for 2 hour prior to the sample collection","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[{"key":2,"offset":0,"length":6}],"data":{}},{"key":"6v1hs","text":"Salivary DNA isolation: Salivary DNA was isolated using commercially available kits (NORWGEN SALIVARY DNA ISOLATION KIT[DSV1]) as per manufacturer's instructions. The DNA concentration per sample was analysed using a bio-spectrophotometer and stored at -200C until further analysis.","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[{"key":3,"offset":85,"length":34},{"key":4,"offset":119,"length":6}],"data":{}},{"key":"8hjji","text":"[DSV1]Put the manufacturer name, serial no, and country of origin


SNP selection and genotyping: SNP was selected based on previous publications and obtained from database http://www.ncbi.nlm.nih.gov. DNA was amplified by polymerase chain reaction (PCR) and examined (by specific restriction enzymes) using the restriction fragment length polymorphism (RFLP) technique. The primer pair for SNP’s is mentioned in the given table (Table 1) The 25 μl PCR reaction mixture consisted of10 mM trisHCl, 200 μM dNTPs, 20 pmol from the primer 1.5 mM MgCl2, 0.5 u taq polymerase (fenzyme), and using 50–100 ng of DNA as template.","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[{"key":5,"offset":0,"length":6}],"data":{}}],"entityMap":{"0":{"type":"link","mutability":"MUTABLE","data":{"guid":"FFB66E86720811ED865E0A58A9FEAC02","url":null}},"1":{"type":"link","mutability":"MUTABLE","data":{"guid":"FFB66F0B720811ED865E0A58A9FEAC02","url":"#_msocom_1"}},"2":{"type":"link","mutability":"MUTABLE","data":{"guid":"FFB66F65720811ED865E0A58A9FEAC02","url":"#_msoanchor_1"}},"3":{"type":"link","mutability":"MUTABLE","data":{"guid":"0D13BD9E720911ED865E0A58A9FEAC02","url":null}},"4":{"type":"link","mutability":"MUTABLE","data":{"guid":"0D13BE0E720911ED865E0A58A9FEAC02","url":"#_msocom_1"}},"5":{"type":"link","mutability":"MUTABLE","data":{"guid":"0D13BE66720911ED865E0A58A9FEAC02","url":"#_msoanchor_1"}}}}
